	  v30Positive NUMBER(10);
	  v30Negative NUMBER(10);
	  v30Neutral NUMBER(10);
	  v180Positive NUMBER(10);
	  v180Negative NUMBER(10);
	  v180Neutral NUMBER(10);
	  vScoreTotal NUMBER(10);
	  vCountTotal NUMBER(10);
   BEGIN
      
	  -- Por cada seller,
	  FOR SELLER_REC IN SELLER_CUR(ndays) LOOP
		-- Buscar el puntaje recibido en las ventas de la ultima semana
		SELECT COUNT(1)
		INTO v7Positive
		FROM REVIEW
		WHERE USER_ID = SELLER_REC.USER_ID
		AND ROLE = 'SELLER'
		AND CREATED > SYSDATE - 7
		AND STATUS = 'PUBLISHED' 
		AND SCORE = 'POSITIVE'
		;
		SELECT COUNT(1)
		INTO v7Negative
		FROM REVIEW
		WHERE USER_ID = SELLER_REC.USER_ID
		AND ROLE = 'SELLER'
		AND CREATED > SYSDATE - 7
		AND STATUS = 'PUBLISHED' 
		AND SCORE = 'NEGATIVE'
		;
		SELECT COUNT(1)
		INTO v7Neutral
		FROM REVIEW
		WHERE USER_ID = SELLER_REC.USER_ID
		AND ROLE = 'SELLER'
		AND CREATED > SYSDATE - 7
		AND STATUS = 'PUBLISHED' 
		AND SCORE = 'NEUTRAL'
		;
		-- Buscar el puntaje recibido en las ventas del ultimo mes
		SELECT COUNT(1)
		INTO v30Positive
		FROM REVIEW
		WHERE USER_ID = SELLER_REC.USER_ID
		AND ROLE = 'SELLER'
		AND CREATED > SYSDATE - 30
		AND STATUS = 'PUBLISHED' 
		AND SCORE = 'POSITIVE'
		;
		SELECT COUNT(1)
		INTO v30Negative
		FROM REVIEW
		WHERE USER_ID = SELLER_REC.USER_ID
		AND CREATED > SYSDATE - 30
		AND ROLE = 'SELLER'
		AND STATUS = 'PUBLISHED' 
		AND SCORE = 'NEGATIVE'
		;
		SELECT COUNT(1)
		INTO v30Neutral
		FROM REVIEW
		WHERE USER_ID = SELLER_REC.USER_ID
		AND CREATED > SYSDATE - 30
		AND ROLE = 'SELLER'
		AND STATUS = 'PUBLISHED' 
		AND SCORE = 'NEUTRAL'
		;
		-- Buscar el puntaje recibido en las ventas de los ultimos seis meses	
		SELECT COUNT(1)
		INTO v180Positive
		FROM REVIEW
		WHERE USER_ID = SELLER_REC.USER_ID
		AND CREATED > SYSDATE - 180
		AND ROLE = 'SELLER'
		AND STATUS = 'PUBLISHED' 
		AND SCORE = 'POSITIVE'
		;
		SELECT COUNT(1)
		INTO v180Negative
		FROM REVIEW
		WHERE USER_ID = SELLER_REC.USER_ID
		AND CREATED > SYSDATE - 180
		AND ROLE = 'SELLER'
		AND STATUS = 'PUBLISHED' 
		AND SCORE = 'NEGATIVE'
		;
		SELECT COUNT(1)
		INTO v180Neutral
		FROM REVIEW
		WHERE USER_ID = SELLER_REC.USER_ID
		AND CREATED > SYSDATE - 180
		AND ROLE = 'SELLER'
		AND STATUS = 'PUBLISHED' 
		AND SCORE = 'NEUTRAL'
		;
		-- Buscar el puntaje recibido en las ventas totales	
		SELECT  nvl(sum(CASE SCORE WHEN 'POSITIVE' THEN 1 WHEN 'NEGATIVE' THEN -1 ELSE 0 END),0), COUNT(1)
		INTO vScoreTotal, vCountTotal
		FROM REVIEW
		WHERE USER_ID = SELLER_REC.USER_ID
		AND ROLE = 'SELLER'
		AND STATUS = 'PUBLISHED' ;		
		-- Insertar el puntaje actualizado
		update_seller_scoring( SELLER_REC.USER_ID, 
						v7Positive, v7Negative, v7Neutral, 
						v30Positive, v30Negative, v30Neutral, 
						v180Positive, v180Negative, v180Neutral, 
						vScoreTotal, vCountTotal
						); 
	  END LOOP;
	  
   END calculate_seller_scoring;
END scoring_pkg;

